Mongoose .save() returns empty error object, does not save in DB<p>I am trying to learn MongoDB and typescript but currently running into some issues when trying to create my first document.</p>
<p>When I make a post request from postman, I get &quot;Sending request&quot; for 5 seconds, then it times out and returns an empty error object:</p>
<pre><code>{
    &quot;message&quot;: {}
}
</code></pre>
<p>and the posted data is not saved in my mongoDB.</p>
<p>I first set up connection like this in my server:</p>
<pre><code>mongoose.connect(&lt;string&gt; process.env.DB_CONNECTION, { useNewUrlParser: true}, () =&gt;
    console.log(&quot;connected to DB!&quot;)
);
</code></pre>
<p>and get back the correct statement logged, so I am connected.</p>
<p>I have a model that looks like this:</p>
<pre><code>import { model, Schema, Model, Document } from &quot;mongoose&quot;;

export interface IUser extends Document {
    name: string,
}

const UserSchema: Schema = new Schema(
    {
        name: {
            type: Schema.Types.String,
            required: true,
        },
    },
    &lt;any&gt; {timeStamps: true}
);

const User: Model&lt;IUser&gt; = model&lt;IUser&gt;('User', UserSchema);
export default User;
</code></pre>
<p>The problem could be in there, but I dont think it is.</p>
<p>Then, here is my post request for the endpoint I call:</p>
<pre><code>router.post('/add', async (req: Request, res: Response): Promise&lt;any&gt; =&gt; {
    try {
        const user: IUser = new User({
            name: req.body.name
        });

        const savedUser: IUser = await user.save();

        res.status(200).json(savedUser);
    } catch (err: any) {
        res.status(500).json({message: err});
        console.log(&quot;There was an error&quot;);
    }
})
</code></pre>
<p>Here is where I believe the error is becuase every time the request gets stuck on awaiting the .save()</p>
<p>Any help would be great! Thanks!</p>

