How do I fix this moment js bug in Mongoose?<p>I've created a <code>posts</code> model in Mongoose, that records all posts created by users.</p>
<pre><code>const mongoose = require('mongoose');
const { Schema } = mongoose;
const moment = require('moment')

const postSchema = new Schema({
// Other fields in DB

timeCreated:{
type:String,
default: moment().valueOf()
}

});

const Posts = mongoose.model('Posts', postSchema);
module.exports = Posts
</code></pre>
<p>The exact part of the code I'm having problems with is this one here:</p>
<pre><code>timeCreated:{
type:String,
default: moment().valueOf()
}
</code></pre>
<p>I'm using the <code>timeCreated</code> object to make time calculations in the front-end. So, when users create posts, the database will indicate that the posts were created at the same time, even if the posts where created hours apart.</p>
<p>See the database snapshot (emails and usernames are fake):</p>
<p><a href="https://i.stack.imgur.com/3onYt.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/3onYt.png" alt="database snapshot 1" /></a></p>
<p><a href="https://i.stack.imgur.com/8xgq8.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/8xgq8.png" alt="database snapshot 1" /></a></p>
<p>If you look closely, the <code>timeCreated</code> object carries the same string value in all 4 posts, regardless of the fact that the posts were created hours apart.
Is there something wrong with my code, or is this a Mongoose/Moment js bug?</p>

