Extract variables from json string<h2><strong>Context :</strong></h2>
<p>I'm making a Discord bot using the <strong>discord.js</strong> library and <strong>MongoDB</strong> (with mongoose). I created a script that can construct messages from data stored in my MongoDB database. For exemple, if an user on my Discord server type &quot;!hello&quot;, it will query my database to construct a reply like &quot;Hello to you!&quot;.</p>
<p>I store my reply message data in an document like this :</p>
<pre class="lang-json prettyprint-override"><code>{
    &quot;command&quot;: &quot;!hello&quot;,
    &quot;content&quot;: &quot;Hello to you!&quot;
}
</code></pre>
<p><em>(I voluntary omitted some properties here that are useless in the context of my question)</em></p>
<p>And retrieve it in my code with something like :</p>
<pre class="lang-js prettyprint-override"><code>let retrievedReply;
await mongo().then(async mongoose =&gt; {
    try {
        let query = {command: message.content};
        retrievedReply = await replySchema.findOne(query);
    } finally {
        mongoose.connection.close();
    }
});
message.reply(retrievedReply.content);
</code></pre>
<h2><strong>My issue :</strong></h2>
<p>Now, imagine I want it to respond &quot;Hello <em><strong>username</strong></em>!&quot;.</p>
<p>If I didn't construct my reply using data from mongo I could simply do something like :</p>
<pre class="lang-js prettyprint-override"><code>message.reply(`Hello ${message.member.nickname}!`);
</code></pre>
<p>or</p>
<pre class="lang-js prettyprint-override"><code>message.reply(&quot;Hello &quot; + message.member.nickname + &quot;!&quot;);
</code></pre>
<p>So, in other words, using <strong>backticks</strong> and <strong>${}</strong> syntax or (but I like it less), splitting my string and concatenate my property value like the second example.</p>
<p>The thing is, we can't store a string inside backticks in json format (used by MongoDB). So even if I build my document like so :</p>
<pre class="lang-json prettyprint-override"><code>{
    &quot;command&quot;: &quot;hello&quot;,
    &quot;content&quot;: &quot;Hello ${message.member.nickname}!&quot;
}
</code></pre>
<p><strong>${message.member.nickname}</strong> would not be interpreted like a property value but just like a simple string.</p>
<h1><strong>The 1000$ question :</strong></h1>
<p>How can I use this property inside my code? I thought about extracting it using regex but it does not change the fact that it will still be a string. Is there a way to &quot;convert&quot; from a string to an usable variable?</p>
<p><strong>EDIT</strong></p>
<p>Since Brettski asked me (rightfully), here is an example of what I want :</p>
<pre class="lang-js prettyprint-override"><code>message.member.send(`Hello ${message.member}!`);
</code></pre>
<p>This <strong>message.member</strong> property here represent a member object of a Discord guild. It contains a lot of things like its permissions on the guild, its roles, etc.
When we use a member object into a message, Discord will make a mention of the member like bellow.</p>
<p><a href="https://i.stack.imgur.com/x1xLj.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/x1xLj.png" alt="Message received from the bot into the application" /></a></p>
<p>It works the same with other properties like channels for example. Users can then click on those to see informations about the member or to go directly to the channel, etc. I want to be able to use this.</p>

