Mongoose query where X is in both arrays and where Y is in only one array<p>I am building a filtering system and I am stuck on a problem, please keep in mind that this is demo code, this is not the same project but the concept is the same, I replaced the names to make it as easily understandable as possible.</p>
<p>I got a filled filter object which gets sent like this <em>(it consists of an array with id's)</em> - keep this one in mind:</p>
<pre class="lang-js prettyprint-override"><code>const filters = {
  companies: [&quot;company_a&quot;, &quot;company_b&quot;], // this is an example, normally it a mongodb ObjectId(&quot;XXXXX&quot;) list
  states: [&quot;state_1&quot;, &quot;state_2&quot;], // this is an example, normally it a mongodb ObjectId(&quot;XXXXX&quot;) list
}
</code></pre>
<p>If you would take a look at both the <code>Company</code> and <code>State</code> collections, they would look something like this:</p>
<pre class="lang-json prettyprint-override"><code>// MongoDB collection: `companies`
[
  {
    &quot;id&quot;: &quot;company_a&quot;,
    &quot;nationwide&quot;: false
  },
  {
    &quot;id&quot;: &quot;company_b&quot;,
    &quot;nationwide&quot;: true
  }
]
// MongoDB collection: `states`
[
  {
    &quot;id&quot;: &quot;state_1&quot;,
    &quot;name&quot;: &quot;Arizona&quot;
  },
  {
    &quot;id&quot;: &quot;state_2&quot;,
    &quot;name&quot;: &quot;Texas&quot;
  }
]
</code></pre>
<p>There is also a global collection which combines both of these, this is the collection I'm going to be using:</p>
<pre class="lang-json prettyprint-override"><code>// MongoDB collection: `country_companies`
[
  /* record 1 */
  {
    &quot;_id&quot;: ObjectId(&quot;XXXXX&quot;),
    &quot;company&quot;: {
      &quot;_id&quot;: &quot;company_a&quot;,
      &quot;nationwide&quot;: false
    },
    &quot;state&quot;: {
      &quot;_id&quot;: &quot;state_1&quot;,
      &quot;name&quot;: &quot;Arizona&quot;
    }
  },
  /* record 2 */
  {
    &quot;_id&quot;: ObjectId(&quot;XXXXX&quot;),
    &quot;company&quot;: {
      &quot;_id&quot;: &quot;company_b&quot;,
      &quot;nationwide&quot;: true
    },
    &quot;state&quot;: {
      &quot;_id&quot;: &quot;state_2&quot;,
      &quot;name&quot;: &quot;Texas&quot;
    }
  }
]
</code></pre>
<hr />
<p>Now, a company can be nationwide as well as state-oriented (as seen in above collection). So I have a repository like this:</p>
<pre class="lang-js prettyprint-override"><code>export class CompanyRepository {
  private companies: Company[];

  public async initialize(): Promise&lt;void&gt; {
    if (this.companies.length &gt; 0) throw new Error(&quot;Companies have already been initialized!&quot;);
    this.companies = await CompanyModel.find().exec();
  }

  public isCompanyNationwide(id: string): boolean {
    return this.companies.some(company =&gt; company.id === id &amp;&amp; company.nationwide === true);
  }
}
</code></pre>
<hr />
<p>The problem occurs that once I execute the query like this, with the filters at the top:</p>
<pre class="lang-js prettyprint-override"><code>export class CompanyService {
  public static async getCompaniesByFilters(filters: CompanyFilters): Promise&lt;Company[]&gt; {
    const query: Record&lt;string, unknown&gt; = {};
    if (filters.companies.length &gt; 0) query['company._id'] = { $in: filters.companies };
    if (filters.states.length &gt; 0) query['state._id'] = { $in: filters.states };
    /* this results in a mongodb query:
      {
        &quot;company._id&quot;: { $in: [&quot;company_a&quot;, &quot;company_b&quot;] },
        &quot;state._id&quot;: { $in: [&quot;state_1&quot;, &quot;state_2&quot;] }  
      }
    */
    return await CountryCompanyModel.find(query).exec();
  }
}
</code></pre>
<p>What the above code basically does, is it adds the items based on if you selected them, in the end you get a query object. The problem there is that it has to be in BOTH arrays. So since <code>&quot;company_a&quot;</code> is nationwide, it shouldn't be searched in the states array.</p>
<hr />
<p>To get a clear view of the point, here are some examples of how the system should work:</p>
<pre><code>User A selects `[&quot;company_a&quot;]`, without any states -&gt;
  Receives a list of all company_a records

User B selects `[&quot;company_a&quot;]`, with the state `[&quot;state_1&quot;]` -&gt;
  Receives list of all company_a in state_1 records

User C selects `[&quot;company_a&quot;, &quot;company_b&quot;]` with the states `[&quot;state_1&quot;]` -&gt;
  Receives a list of all company_a in state_1, together with all company_b (since company B is nation-wide)

User D selects `[&quot;company_b&quot;]` with the states `[&quot;state_1&quot;, &quot;state_2&quot;]` -&gt;
  Receives a list of all company_b, because company_b is nation wide so states filter should be ignored entirely.
</code></pre>
<p>A solution I can think of is this:</p>
<pre class="lang-js prettyprint-override"><code>import CompanyRepository from &quot;./company.repository&quot;;

const stateWideCompanies = filters.companies.filter(companyId =&gt; 
  CompanyRepository.isCompanyNationWide(companyId) === false
);
const nationWideCompanies = filters.companies.filter(companyId =&gt; 
  CompanyRepository.isCompanyNationWide(companyId) === true
);

const countryCompaniesStates = await CountryCompanyModel.find({&quot;company._id&quot;: { $in: stateWideCompanies }, &quot;state._id&quot;: { $in: filters.states }).exec(); 
const countryCompaniesNation = await CountryCompanyModel.find({&quot;company._id&quot;: { $in: nationWideCompanies }).exec();

const companyList = [...countryCompaniesStates, ...countryCompaniesNation]
</code></pre>
<p>This gives me what I want, however I think this should be able to be completed by the database. Because now I have to do two queries and combine them both, this does not look clean at all.</p>
<p><strong>I hope that I can do this in ONE query to the database. So either the query builder should be fixed or the query itself, I can't seem to get it working properly..</strong></p>

